// frontend/src/pages/MentionsLegales.js
import React from 'react';

const MentionsLegales = () => {
  return (
    <div className="legal-page">
      <h2>Mentions légales</h2>
      
      <div className="content-card">
        <p>
          Cette application est développée à des fins éducatives et informationnelles.
        </p>
        
        <p>
          EuroMillions App n'est pas affiliée à la Française des Jeux (FDJ) ni à aucun opérateur officiel de loterie.
        </p>
        
        <p>
          Les informations fournies sur cette application sont à titre indicatif uniquement et ne constituent pas des conseils financiers ou des garanties de gain.
        </p>
        
        <p>
          Les résultats des tirages EuroMillions présentés sont obtenus à partir de sources publiques et sont fournis sans garantie d'exactitude.
        </p>
        
        <p>
          Les prédictions générées par cette application reposent sur des analyses statistiques et ne garantissent aucunement de futurs résultats.
        </p>
      </div>
    </div>
  );
};

export default MentionsLegales;
